import React from 'react';
import PropTypes from 'prop-types';

const Home = () => {
  return (
    <section id="home" className="min-h-screen pt-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        {/* Main Content */}
        <div className="flex flex-col lg:flex-row items-start justify-between gap-12">
          {/* Left Content */}
          <div className="lg:w-1/2 space-y-6">
            <h1 className="text-4xl lg:text-5xl font-mono">
              Elias is a{' '}
              <span className="text-[#C778DD]">web designer</span> and{' '}
              <span className="text-[#C778DD]">front-end developer</span>
            </h1>

            <p className="text-[#ABB2BF]">
              He crafts responsive websites where technologies meet creativity
            </p>

            <button className="border border-[#C778DD] px-4 py-2 hover:bg-[#C778DD] hover:text-white transition-colors">
              Contact me!!
            </button>
          </div>

          {/* Right Content with Image */}
          <div className="lg:w-1/2 relative">
            {/* Decorative Squares */}
            <div className="absolute -right-4 top-4">
              <div className="relative w-16 h-16">
                <div className="absolute border border-[#C778DD] w-full h-full"></div>
                <div className="absolute border border-[#C778DD] w-full h-full rotate-45"></div>
              </div>
            </div>

            {/* Image Container */}
            <div className="relative">
              <img
                src="/images/profile.svg"
                alt="Elias"
                className="w-full"
              />

          {/* Dots Pattern */}
          <div className="absolute -right-8 bottom-8 w-24 h-24 dots-pattern"></div>

              {/* Currently Working Badge */}
              <div className="absolute -bottom-6 left-6 right-6 bg-[#282C33] p-2 border border-[#ABB2BF]">
                <div className="flex items-center gap-2">
                  <div className="w-2 h-2 bg-[#C778DD] rounded-full"></div>
                  <span className="text-[#C778DD]">Currently working on</span>
                  <span className="text-[#ABB2BF]">Portfolio</span>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Quote Section */}
        <div className="mt-32 relative max-w-2xl">
          {/* Quote Box */}
          <div className="absolute -bottom-6 left-6 right-6 bg-[#282C33] p-2 border border-[#ABB2BF] text-left">
            <p className="text-white">
              &quot;With great power comes great electricity bill&quot;
            </p>
            <p className="text-[#C778DD] text-right">- Dr. Who</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
